   "source": [
    "#use set.seed() function to ensure that our results are reproducible\n",
    "set.seed(123)\n",
    "\n",
    "# Set the number of clusters to 5\n",
    "k <- 5\n",
    "kmeans_result <- kmeans(scaled_df,centers = k,nstart = 25)"
   ]
